import Layout from "../../Layout";
import VinpearlnhatrangJSON from "../../Data/Places/Vinpearlnhatrang";

const Vinpearlnhatrang = (props) => {
  return Layout({
    page: VinpearlnhatrangJSON,
    rootImgPath: "Img/Places/Vinpearlnhatrang/",
  });
};

export default Vinpearlnhatrang;
